import React, { Component } from 'react';
import { Card, Switch, Tag, Input, Checkbox, Select } from 'antd';
import 'antd/dist/antd.css';

const { Search } = Input;

const { Option } = Select;

export class App extends Component {
  state = {
    denomination: false
  }

  onChange = (e) => {
    this.setState({denomination: e.target.checked});
  }

  onDispatch = (e) => {

  }

  render() {
    return (
      <Card title="ATM Machine" style={{ width: 300, textAlign: "center", margin: "auto" }}>
        <p>Available Notes :</p>
        <Tag color="magenta">10</Tag>
        <Tag color="red">20</Tag>
        <Tag color="cyan">50</Tag>
        <br />
        <Tag color="blue">100</Tag>
        <Tag color="green">200</Tag>
        <Tag color="purple">1000</Tag>

        <Checkbox onChange={this.onChange} style={{margin: "50px 0"}}>Denoimation</Checkbox>

        <Search placeholder="Preferred Denomination" allowClear enterButton="Dispatch" size="small" onSearch={this.onDispatch} />

        <Select defaultValue="lucy" style={{ width: 120 }} onChange={handleChange}>
          <Option value="jack">Jack</Option>
          <Option value="lucy">Lucy</Option>
          <Option value="disabled" disabled>
            Disabled
          </Option>
          <Option value="Yiminghe">yiminghe</Option>
        </Select>

        <Search placeholder="Amount" allowClear enterButton="Dispatch" size="small" onSearch={this.onDispatch} />
      </Card>
    )
  }
}

export default App
